import{_ as i,E as e,c as l,m as s,a as o,J as a,w as p,a4 as A,o as c}from"./chunks/framework.uQk9_EO2.js";const d="/docs/cocos/assets/build-panel.Cr377JO8.png",h="/docs/cocos/assets/panel.syCT90eV.png",u="/docs/cocos/assets/build-options.D6HToQ8M.png",b="data:image/png;base64,",m="/docs/cocos/assets/create-scene-first.CC6WtJNf.png",B="/docs/cocos/assets/save-scene.DpoXdUpu.png",w="/docs/cocos/assets/build-page.L-gMWR5A.png",n="data:image/png;base64,",E="data:image/png;base64,",I="/docs/cocos/assets/clean-window.C-HkvH3y.png",V="/docs/cocos/assets/build-task.DoTJ-PzC.png",X="/docs/cocos/assets/remove-build-task.oP6hOkB-.png",_="data:image/png;base64,",D="data:image/png;base64,",t="data:image/png;base64,",r="data:image/png;base64,",R="/docs/cocos/assets/edit-build-option.BkykbN3N.png",f="/docs/cocos/assets/settings.De2IXWm2.png",T="/docs/cocos/assets/interrupt.XvPlBK4r.gif",C="/docs/cocos/assets/build-dropdown.DFrFZ0zQ.png",H=JSON.parse('{"title":"构建发布面板详解","description":"","frontmatter":{},"headers":[],"relativePath":"zh/editor/publish/build-panel.md","filePath":"zh/editor/publish/build-panel.md","lastUpdated":1712305443000}'),Z={name:"zh/editor/publish/build-panel.md"},F=A('<h1 id="构建发布面板详解" tabindex="-1">构建发布面板详解 <a class="header-anchor" href="#构建发布面板详解" aria-label="Permalink to &quot;构建发布面板详解&quot;">​</a></h1><p>点击编辑器主菜单中的 <strong>项目 -&gt; 构建发布</strong> 或者使用快捷键 <code>Ctrl/Cmd + Shift + B</code> 即可打开 <strong>构建发布</strong> 面板：</p><p><img src="'+d+'" alt="build-panel"></p><p>若已经构建过某一平台，则打开 <strong>构建发布</strong> 面板会进入 <strong>构建任务</strong> 页面。v3.0 各个平台的构建是以构建任务的形式进行，类似于下载任务：</p><p><img src="'+h+'" alt="panel"></p><h2 id="构建发布面板" tabindex="-1">构建发布面板 <a class="header-anchor" href="#构建发布面板" aria-label="Permalink to &quot;构建发布面板&quot;">​</a></h2><p>在 <strong>构建发布</strong> 面板选择需要构建的平台，然后配置 <a href="./build-options">构建选项</a>。配置完成后，点击右下角的 <strong>构建</strong> 按钮即可跳转到 <strong>构建任务</strong> 页面执行构建流程。或者点击右上角的 <strong>关闭（X）</strong> 按钮也可以进入 <strong>构建任务</strong> 页面。</p><p><strong>构建发布</strong> 面板上方有三个功能按钮：</p><p><img src="'+u+'" alt="build-options"></p><ul><li><p><img src="'+b+'" alt="doc">：点击该按钮即可跳转到当前平台的官方手册文档。</p></li><li><p><strong>Import</strong>：点击该按钮即可导入保存了构建选项配置的 json 文件。</p></li><li><p><strong>Export</strong>：点击该按钮可将当前平台的构建选项配置导出为 json 文件，用于 <a href="./publish-in-command-line">命令行构建</a>，也可以在项目成员之间共享构建选项配置。导出的配置是按照平台区分的，并且带有版本号，请不要删除版本号，以免在跨版本导入配置时无法进行数据迁移。使用命令行构建时，将构建参数 <code>configPath</code> 的文件路径指定为导出的 json 配置文件路径即可。</p></li></ul><blockquote><p><strong>注意</strong>：</p><ol><li><p>构建没有场景的项目是没有意义的，所以如果当前打开的项目没有场景，则打开 <strong>构建发布</strong> 面板时会提示请先创建场景：</p><p><img src="'+m+'" alt="save-scene"></p></li><li><p>在构建之前，请确保当前的场景已经保存，否则点击 <strong>构建</strong> 按钮时将会弹框提示，可以选择 <strong>保存</strong>、<strong>忽略</strong> 或者 <strong>取消构建</strong>。选择 <strong>保存</strong> 和 <strong>忽略</strong> 都会继续执行构建流程。</p><p><img src="'+B+'" alt="save-scene"></p></li></ol></blockquote><h2 id="构建任务页面" tabindex="-1">构建任务页面 <a class="header-anchor" href="#构建任务页面" aria-label="Permalink to &quot;构建任务页面&quot;">​</a></h2><p>在 <strong>构建任务</strong> 页面可以查看当前平台的构建进度及构建结果。</p><ul><li>正在构建中：进度条显示为 <strong>蓝色</strong>。</li><li>构建成功：进度条到达 100%，输出实际构建时间并显示为 <strong>绿色</strong>。</li><li>构建失败：进度条到达 100%，提示构建失败原因或者报错信息，并显示为 <strong>红色</strong>。</li></ul><p><img src="'+w+'" alt="panel"></p><p>该页面上方有三个按钮，包括 <strong>新建构建任务</strong>、<strong>打开构建调试工具</strong> 和 <strong>清空构建缓存</strong>：</p><ul><li><p><strong>新建构建任务</strong>：点击该按钮即可返回 <strong>构建发布</strong> 面板，选择新的平台进行构建。</p></li><li><p><img src="'+n+'" alt="debug">：打开构建调试工具，点击该按钮即可打开构建调试工具，查看在构建过程中产生的全部日志信息包括调用栈。</p></li><li><p><img src="'+E+'" alt="clean">：清空构建缓存。为了复用可被重复利用的构建结果，以便重新构建时加快构建速度、降低内存占用等，构建过程中的很多处理都添加了缓存管理机制，例如压缩纹理、自动图集生成、引擎编译、资源序列化 JSON 等。<br>正常情况下这部分缓存数据是不需要手动清理的，但如果是在特殊情况下需要避免缓存干扰，可以点击该按钮来清空缓存数据。</p><p>项目相关的资源缓存会存储在项目目录下，引擎编译相关的缓存则存储在全局目录下，开发者可根据自己的需要选择清空项目缓存、全局缓存，或者全部清空。</p><p><img src="'+I+'" alt="clean window"></p></li></ul><h3 id="平台构建任务" tabindex="-1">平台构建任务 <a class="header-anchor" href="#平台构建任务" aria-label="Permalink to &quot;平台构建任务&quot;">​</a></h3><p>各个平台的构建是以构建任务的形式进行，类似于下载任务。平台构建任务的名称取决于 <strong>构建发布</strong> 面板中的 <strong>发布路径</strong> 选项，具体可查看 <a href="./build-options">构建选项</a> 文档。</p><p><img src="'+V+'" alt="build task"></p><p>每个构建任务都配置了相应的功能按钮方便使用。</p><p><strong>构建任务右上方的移除（X）按钮</strong> 用于移除当前构建任务，可选择 <strong>仅移除构建记录</strong> 或者 <strong>删除源文件</strong>。<strong>删除源文件</strong> 即删除对应平台构建后生成在 <code>build</code> 目录下的项目发布包。</p><p><img src="'+X+'" alt="remove build task"></p><p><strong>构建任务左下方的按钮包括</strong>：</p><ul><li><p><img src="'+_+'" alt="folder">：点击该按钮即可打开对应平台构建后生成的项目发布包（默认在 <code>build</code> 目录下）。</p></li><li><p><img src="'+D+'" alt="editing">：点击该按钮即可返回 <strong>构建发布</strong> 面板，修改对应平台上一次构建时配置的构建选项，然后点击右下方的 <strong>构建</strong> 按钮重新构建。详情请参考下方 <strong>修改构建选项</strong> 部分的内容。</p></li><li><p><img src="'+t+'" alt="setting">：点击该按钮即可返回 <strong>构建发布</strong> 面板，查看对应平台上次构建时配置的构建选项。</p></li><li><p><img src="'+r+'" alt="log-file">：点击该按钮即可打开对应平台在构建过程中产生的日志文件或者日志文件所在目录，可通过 <strong>偏好设置 -&gt; 构建发布 -&gt; 日志文件打开方式</strong> 进行设置。更多内容请参考下方 <strong>构建日志信息查看</strong> 部分的内容。</p></li></ul><p><strong>构建任务右下方的按钮</strong>，主要用于各个平台在构建完成后根据平台要求执行生成、运行、上传等发布流程。<strong>Build</strong> 按钮则是用于重新构建。</p><p>各个平台完成构建后，与构建相关的构建选项配置信息都会保存在项目目录下的 <code>profiles/v2/packages/builder.json</code> 文件中，只要没有在 <strong>构建任务</strong> 页面删除对应平台的构建任务或者删除 <code>build</code> 目录下的项目发布包，就可以在重新打开编辑器后查看上次构建时的构建选项配置，以及继续运行预览等。</p><p>各个平台具体的发布流程，可参考：</p><ul><li><a href="./native-options">发布到原生平台</a></li><li><a href="./publish-mini-game">发布到小游戏平台</a></li></ul><h3 id="修改构建选项" tabindex="-1">修改构建选项 <a class="header-anchor" href="#修改构建选项" aria-label="Permalink to &quot;修改构建选项&quot;">​</a></h3><p>点击构建任务左下方的编辑按钮，即可返回 <strong>构建发布</strong> 面板修改上次构建时配置的构建选项，以便重新构建。因为只能修改当前平台上一次构建时的构建选项配置，所以页面中的 <strong>发布平台</strong> 项为置灰状态，不可修改。</p><p><img src="'+R+'" alt="edit build option"></p><p>当前平台上一次构建时的构建选项配置可点击编辑按钮右侧的 <img src="'+t+'" alt="setting"> 按钮查看。</p><p>修改完成后点击 <strong>构建</strong> 按钮就会清空上次构建后生成的项目发布包并重新构建。或者点击 <strong>构建发布</strong> 面板右上方的 <strong>X</strong> 按钮返回 <strong>构建任务</strong> 页面，再点击平台构建任务右下方的 <strong>构建</strong> 按钮也可以重新构建。</p><blockquote><p><strong>注意</strong>：</p><ol><li>原生平台为了避免误删除已定制的内容，在重新构建时仅更新项目资源，不会覆盖原有的原生工程内容。因此在返回 <strong>构建发布</strong> 面板修改之前配置的构建选项时，原生平台相关的构建选项为 <strong>禁用</strong> 状态。如果需要重新生成工程请新建构建任务。</li><li>从 v3.3 开始，原生平台在重新构建时，构建选项 <strong>游戏名称</strong> 为置灰状态，不可修改。</li></ol></blockquote>',35),J=s("strong",null,"构建",-1),Y=s("strong",null,"构建发布",-1),Q=s("code",null,"build",-1),S=s("strong",null,"构建发布",-1),k=A('<p><img src="'+f+'" alt="settings"></p><h3 id="构建日志信息查看" tabindex="-1">构建日志信息查看 <a class="header-anchor" href="#构建日志信息查看" aria-label="Permalink to &quot;构建日志信息查看&quot;">​</a></h3><p>由于构建过程会产生非常多的日志信息，默认情况下只有错误信息才会打印到编辑器的 <strong>控制台</strong> 面板中。</p><p>如果需要查看所有的日志信息有以下几种操作方式：</p><ul><li><p><strong>打开构建调试工具</strong></p><p>通过点击主菜单中的 <strong>开发者 -&gt; 打开构建调试工具</strong> 或者点击 <strong>构建任务</strong> 页面右上方的 <img src="'+n+'" alt="debug"> 按钮，即可查看在构建过程中打印出的全部日志信息包括调用栈。</p></li><li><p><strong>打开构建日志记录文件</strong></p><p>每次构建过程中产生的报错信息都会被记录存储在项目目录下的 <code>temp/builder/log</code> 文件夹中。点击构建任务左下方的 <img src="'+r+'" alt="log-file"> 按钮即可查看。在反馈构建相关问题时，可直接附上该文件以便定位问题。</p></li></ul><h3 id="构建队列和取消构建" tabindex="-1">构建队列和取消构建 <a class="header-anchor" href="#构建队列和取消构建" aria-label="Permalink to &quot;构建队列和取消构建&quot;">​</a></h3><p><img src="'+T+'" alt="interupt"></p><p>构建过程中依旧可以添加新的构建任务，此时新的构建任务会加入到构建队列中。 在构建的过程中，可以点击构建任务右侧的 X 按钮来中断当前的构建任务。</p><h3 id="构建和仅构建-bundle" tabindex="-1">构建和仅构建 Bundle <a class="header-anchor" href="#构建和仅构建-bundle" aria-label="Permalink to &quot;构建和仅构建 Bundle&quot;">​</a></h3><p><img src="'+C+'" alt="build-dropdown.png"></p><p>自 v3.8 起，Cocos Creator 支持仅构建 Bundle，仅构建 Bundle，可以一次性构建选中的所有 Bundle，和单独的构建 Bundle 不同，仅构建 Bundle，会根据 Bundle 的优先级，将公共资源放在优先级高的 Bundle 内。</p>',11);function v(x,K,P,N,U,O){const g=e("font");return c(),l("div",null,[F,s("p",null,[o("如果修改配置后没有点击 "),J,o(" 按钮重新构建，修改的配置也会被保存起来。若当前 "),Y,o(" 面板中的配置与上次构建后生成的 "),Q,o(" 目录下的项目发布包中的配置不一致，"),S,o(" 面板的上方会显示黄色的 "),a(g,{color:"#F0C800"},{default:p(()=>[o("*")]),_:1}),o(" 号键。")]),k])}const j=i(Z,[["render",v]]);export{H as __pageData,j as default};
